import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchUserProfile, initializeUser } from "../Features/Auth/AuthSlice";
import { useNavigate } from "react-router-dom";
import UserHeader from "../components/User-Header/UserHeader";
import UserTransactions from "../components/User-Transactions/UserTransactions";

const Profile = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user, token, status, error } = useSelector((state) => state.auth);

  useEffect(() => {
    if (token) {
      dispatch(initializeUser());
    } else {
      navigate("/login");
    }
  }, [dispatch, token, navigate]);

  if (status === "loading") {
    return <div>Loading...</div>;
  }

  if (status === "failed") {
    return <div>Error: {error.message || 'An error occurred'}</div>;
  }

  if (!user) {
    return <div>No user data available. Please login again.</div>;
  }

  return (
    <main className="main bg-dark user-page">
      <UserHeader user={user} />
      <UserTransactions />
    </main>
  );
};

export default Profile;
